import React, { useState } from 'react'
import { Link } from 'react-router-dom'
import "./menu.css"
function Menu({set,setCart,functionn}) {
    const design={
        color:"white",
        textDecoration:"none"
    }
    const show=()=>{
     set(true)
    }
    const hide=()=>{
        set(false)
    }
  return (
    <div className='navmenu' onMouseEnter={show} onMouseLeave={hide}>
        <ul>
        <li onMouseEnter={()=>setCart("third-Person")} onClick={functionn()}><Link to="/" style={design}>Third-Person</Link></li>
        <li onMouseEnter={()=>setCart("shooter")} onClick={functionn()}><Link to="/" style={design}>Shooter</Link></li>
        <li onMouseEnter={()=>setCart("zombie")} onClick={functionn()}><Link to="/" style={design}>Zombie</Link></li>
        <li onMouseEnter={()=>setCart("3d")} onClick={functionn()}><Link to="/" style={design}>3d</Link></li>
        <li onMouseEnter={()=>setCart("2d")} onClick={functionn()}><Link to="/" style={design}>2d</Link></li>
        <li onMouseEnter={()=>setCart("s")} onClick={functionn()}><Link to="/" style={design}>Anime</Link></li>
        <li onMouseEnter={()=>setCart("shooter")} onClick={functionn()}><Link to="/" style={design}>Sci-fi</Link></li>
        <li onMouseEnter={()=>setCart("sandbox")} onClick={functionn()}><Link to="/" style={design}>Sandbox</Link></li>
        <li onMouseEnter={()=>setCart("shooter")} onClick={functionn()}><Link to="/" style={design}>Sport</Link></li>
        <li onMouseEnter={()=>setCart("shooter")} onClick={functionn()}><Link to="/" style={design}>Superhero</Link></li>
        <li onMouseEnter={()=>setCart("shooter")} onClick={functionn()}><Link to="/" style={design}>Martial-arts</Link></li>
        </ul>
        </div>
  )
}

export default Menu
